CREATE TABLE `sys_theme` (
  `id` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键ID',
  `user_id` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户ID',
